import re

def descending_order(lst):

    def clean_string(s):
        return re.sub('\\W+|\\d+', '', s).lower()
    n = len(lst)
    for i in range(n):
        for j in range(1, n - i - 1):
            if clean_string(lst[j]) < clean_string(lst[j + 1]):
                (lst[j], lst[j + 1]) = (lst[j + 1], lst[j])
    return lst

